import React from 'react';
import './thankyou.css'; 

const ThankYouPage = () => {
  return (
    <div className="thank-you-container">
      <h1>Thank You!</h1>
      <p>Your submission was successful. We will contact you soon.</p>
    </div>
  );
};

export default ThankYouPage;
